export class HeaderDescriptionHtmlBox{constructor(n){let i="/PageComponents/"+this.constructor.name,t=document.createElement("link");t.setAttribute("rel","stylesheet");t.setAttribute("href",i+"/style"+n+".css");document.head.append(t)}InsertAdjacentHTML(n,t,i){let r='<div id="'+this.constructor.name+'"><p>'+i+"<\/p><\/div>";n.insertAdjacentHTML(t,r)}}